import React from "react";
import MovieDetail from "../components/moviedetail/MovieDetail";
import Headers from "../components/layout/Headers";
import Footers from "../components/layout/Footers";

const Detail = () => {
  return (
    <>
      <Headers />
      <MovieDetail />
      <Footers />
    </>
  );
};

export default Detail;
